import{_ as n,p as t,q as o,a1 as i}from"./framework-d81ad7e5.js";const e={},s=i('<h3 id="input事件" tabindex="-1"><a class="header-anchor" href="#input事件" aria-hidden="true">#</a> input事件</h3><ul><li><strong>onfocus</strong> 当input 获取到焦点时触发</li><li><strong>onblur</strong> 当input失去焦点时触发，注意：这个事件触发的前提是已经获取了焦点再去焦点的时候会触发相应的js</li><li><strong>onchange</strong> 当input失去焦点并且它的value值发生变化时触发</li><li><strong>onkeydown</strong> 在 input中有键按住的时候执行一些代码</li><li><strong>onkeyup</strong> 在input中有键抬起的时候触发的事件，在此事件触发之前一定触发 <strong>onkeydown事件</strong></li><li><strong>onclick</strong> 主要是用于 input type=button，当被点击时触发此事件</li><li><strong>onselect</strong> 当input里的内容文本被选中后执行一段，只要选择了就会触发，不是非全部选中</li><li><strong>oninput</strong> 当input的value值发生变化时就会触发，不用等到失去焦点（与onchange的区别）</li></ul>',2),r=[s];function l(u,a){return t(),o("div",null,r)}const p=n(e,[["render",l],["__file","js_input_event.html.vue"]]);export{p as default};
